import Head from 'next/head'
import NavigationBar from '../components/NavigationBar'
import Layout from '../components/Layout'


export class index extends Component {
  render() {
    return (
      <div>
          <Layout />
          <title>I'm Marcus Foo</title>

          
          
        
        <h1>Test</h1>

        
      </div>
    )
  }
}

export default index
